    <p style="margin-top:1.45pt; margin-bottom:0.05pt; text-align:center; widows:0; orphans:0; font-size:8pt;"><span style="font-family:'Bookman Old Style';">&nbsp;</span></p>
    <p style="margin-top:0.05pt; margin-bottom:1.65pt; line-height:7pt; widows:0; orphans:0;"><span style="font-family:'Bookman Old Style'; font-size:7pt;">&nbsp;</span></p>
    <p style="margin:1.65pt 27pt 0.45pt 18pt; text-align:justify; line-height:125%; widows:0; orphans:0; font-size:10pt;"><span style="width:18pt; font-family:'Bookman Old Style'; letter-spacing:-0.05pt; display:inline-block;">&nbsp;</span><span style="width:36pt; font-family:'Bookman Old Style'; letter-spacing:-0.05pt; display:inline-block;">&nbsp;</span><span style="font-family:'Bookman Old Style'; letter-spacing:-0.05pt;">I&nbsp;</span><span style="font-family:'Bookman Old Style';">hereby</span><span style="font-family:'Bookman Old Style'; letter-spacing:-0.35pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">certify that these</span><span style="font-family:'Bookman Old Style'; letter-spacing:2.2pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">are</span><span style="font-family:'Bookman Old Style'; letter-spacing:-0.15pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">true</span><span style="font-family:'Bookman Old Style'; letter-spacing:-0.2pt;">&nbsp;and correct&nbsp;</span><span style="font-family:'Bookman Old Style';">statements</span><span style="font-family:'Bookman Old Style'; letter-spacing:1.9pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">of</span><span style="font-family:'Bookman Old Style'; letter-spacing:-0.1pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">my assets,</span><span style="font-family:'Bookman Old Style'; letter-spacing:2.45pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">liabilities,</span><span style="font-family:'Bookman Old Style'; letter-spacing:2pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">net worth,</span><span style="font-family:'Bookman Old Style'; letter-spacing:2pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">business</span><span style="font-family:'Bookman Old Style'; letter-spacing:-0.45pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">interests</span><span style="font-family:'Bookman Old Style'; letter-spacing:2pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">and</span><span style="font-family:'Bookman Old Style'; letter-spacing:2.25pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">financial</span><span style="font-family:'Bookman Old Style'; letter-spacing:-0.4pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">connections,</span><span style="font-family:'Bookman Old Style'; letter-spacing:1.8pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">including</span><span style="font-family:'Bookman Old Style'; letter-spacing:-0.45pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">those</span><span style="font-family:'Bookman Old Style'; letter-spacing:2.2pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">of</span><span style="font-family:'Bookman Old Style'; letter-spacing:-0.1pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">my</span><span style="font-family:'Bookman Old Style'; letter-spacing:-0.15pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">spouse</span><span style="font-family:'Bookman Old Style'; letter-spacing:-0.35pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">and unmarried children below eighteen (18)</span><span style="font-family:'Bookman Old Style'; letter-spacing:2.35pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">years</span><span style="font-family:'Bookman Old Style'; letter-spacing:2.2pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">of</span><span style="font-family:'Bookman Old Style'; letter-spacing:-0.1pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">age living in my household,</span><span style="font-family:'Bookman Old Style'; letter-spacing:2.25pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">and that to the best of my knowledge, the above-enumerated are names</span><span style="font-family:'Bookman Old Style'; letter-spacing:2.15pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">of</span><span style="font-family:'Bookman Old Style'; letter-spacing:-0.1pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">my</span><span style="font-family:'Bookman Old Style'; letter-spacing:-0.15pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">relatives</span><span style="font-family:'Bookman Old Style'; letter-spacing:2.05pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">in</span><span style="font-family:'Bookman Old Style'; letter-spacing:-0.1pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">the</span><span style="font-family:'Bookman Old Style'; letter-spacing:-0.15pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">government</span><span style="font-family:'Bookman Old Style'; letter-spacing:1.85pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">within the fourth civil degree of consanguinity or affinity.&nbsp;</span></p>
    <p style="margin:0.45pt 27pt 0pt 18pt; text-align:justify; line-height:7pt; widows:0; orphans:0;"><span style="font-family:'Bookman Old Style'; font-size:7pt;">&nbsp;</span></p>
    <p style="margin:0pt 27pt 0.35pt 18pt; text-indent:54pt; text-align:justify; line-height:125%; widows:0; orphans:0; font-size:10pt;"><span style="font-family:'Bookman Old Style';">I</span><span style="font-family:'Bookman Old Style'; letter-spacing:-0.05pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">hereby</span><span style="font-family:'Bookman Old Style'; letter-spacing:-0.35pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">authorize</span><span style="font-family:'Bookman Old Style'; letter-spacing:-0.45pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">the</span><span style="font-family:'Bookman Old Style'; letter-spacing:-0.15pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">Ombudsman</span><span style="font-family:'Bookman Old Style'; letter-spacing:1.85pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">or</span><span style="font-family:'Bookman Old Style'; letter-spacing:-0.1pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">his/her</span><span style="font-family:'Bookman Old Style'; letter-spacing:-0.15pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">duly</span><span style="font-family:'Bookman Old Style'; letter-spacing:-0.2pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">authorized</span><span style="font-family:'Bookman Old Style'; letter-spacing:-0.5pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">representative</span><span style="font-family:'Bookman Old Style'; letter-spacing:-0.75pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">to</span><span style="font-family:'Bookman Old Style'; letter-spacing:-0.1pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">obtain</span><span style="font-family:'Bookman Old Style'; letter-spacing:-0.3pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">and</span><span style="font-family:'Bookman Old Style'; letter-spacing:-0.2pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">secure</span><span style="font-family:'Bookman Old Style'; letter-spacing:-0.35pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">from all</span><span style="font-family:'Bookman Old Style'; letter-spacing:2.45pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">appropriate</span><span style="font-family:'Bookman Old Style'; letter-spacing:1.85pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">government</span><span style="font-family:'Bookman Old Style'; letter-spacing:1.85pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">agencies,</span><span style="font-family:'Bookman Old Style'; letter-spacing:2pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">including</span><span style="font-family:'Bookman Old Style'; letter-spacing:2pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">the</span><span style="font-family:'Bookman Old Style'; letter-spacing:2.3pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">Bureau</span><span style="font-family:'Bookman Old Style'; letter-spacing:-0.35pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">of</span><span style="font-family:'Bookman Old Style'; letter-spacing:2.35pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">Internal</span><span style="font-family:'Bookman Old Style'; letter-spacing:-0.4pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">Revenue</span><span style="font-family:'Bookman Old Style'; letter-spacing:2pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">such</span><span style="font-family:'Bookman Old Style'; letter-spacing:2.2pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">documents</span><span style="font-family:'Bookman Old Style'; letter-spacing:1.9pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">that</span><span style="font-family:'Bookman Old Style'; letter-spacing:2.25pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">may show</span><span style="font-family:'Bookman Old Style'; letter-spacing:2.45pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">my</span><span style="font-family:'Bookman Old Style'; letter-spacing:-0.15pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">assets,</span><span style="font-family:'Bookman Old Style'; letter-spacing:2.1pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">liabilities,</span><span style="font-family:'Bookman Old Style'; letter-spacing:2pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">net worth,</span><span style="font-family:'Bookman Old Style'; letter-spacing:2pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">business</span><span style="font-family:'Bookman Old Style'; letter-spacing:-0.45pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">interests</span><span style="font-family:'Bookman Old Style'; letter-spacing:2pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">and</span><span style="font-family:'Bookman Old Style'; letter-spacing:2.25pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">financial</span><span style="font-family:'Bookman Old Style'; letter-spacing:2.05pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">connections,</span><span style="font-family:'Bookman Old Style'; letter-spacing:1.8pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">to</span><span style="font-family:'Bookman Old Style'; letter-spacing:2.35pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">include</span><span style="font-family:'Bookman Old Style'; letter-spacing:2.1pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">those</span><span style="font-family:'Bookman Old Style'; letter-spacing:-0.25pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">of</span><span style="font-family:'Bookman Old Style'; letter-spacing:2.35pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">my spouse and</span><span style="font-family:'Bookman Old Style'; letter-spacing:-0.2pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">unmarried</span><span style="font-family:'Bookman Old Style'; letter-spacing:-0.5pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">children</span><span style="font-family:'Bookman Old Style'; letter-spacing:-0.4pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">below</span><span style="font-family:'Bookman Old Style'; letter-spacing:-0.3pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">18</span><span style="font-family:'Bookman Old Style'; letter-spacing:-0.1pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">years</span><span style="font-family:'Bookman Old Style'; letter-spacing:-0.25pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">of</span><span style="font-family:'Bookman Old Style'; letter-spacing:-0.1pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">age</span><span style="font-family:'Bookman Old Style'; letter-spacing:2.25pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">living</span><span style="font-family:'Bookman Old Style'; letter-spacing:-0.25pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">with</span><span style="font-family:'Bookman Old Style'; letter-spacing:-0.2pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">me</span><span style="font-family:'Bookman Old Style'; letter-spacing:2.3pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">in</span><span style="font-family:'Bookman Old Style'; letter-spacing:-0.1pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">my</span><span style="font-family:'Bookman Old Style'; letter-spacing:-0.15pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">household</span><span style="font-family:'Bookman Old Style'; letter-spacing:1.95pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">covering</span><span style="font-family:'Bookman Old Style'; letter-spacing:-0.45pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">previous</span><span style="font-family:'Bookman Old Style'; letter-spacing:-0.4pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">years to include</span><span style="font-family:'Bookman Old Style'; letter-spacing:-0.35pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">the</span><span style="font-family:'Bookman Old Style'; letter-spacing:-0.15pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">year</span><span style="font-family:'Bookman Old Style'; letter-spacing:2.25pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">I</span><span style="font-family:'Bookman Old Style'; letter-spacing:-0.05pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">first</span><span style="font-family:'Bookman Old Style'; letter-spacing:2.25pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">assumed</span><span style="font-family:'Bookman Old Style'; letter-spacing:2pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">office</span><span style="font-family:'Bookman Old Style'; letter-spacing:-0.25pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">in</span><span style="font-family:'Bookman Old Style'; letter-spacing:2.35pt;">&nbsp;</span><span style="font-family:'Bookman Old Style';">government.</span></p>
